    <div className="tech_columns">

      <div className="tech_bullets">
        <ul>
          <li>JavaScript</li>
          <li>HTML</li>
          <li>CSS</li>
        </ul>
      </div>
      <div>
        <ul>
          <li>JavaScript</li>
